import Mock from 'mockjs'
const Random = Mock.Random;
var GetAppInfoList = [];
for (let i = 0; i < 5; i++) {
    let obj = {};
    obj.appId = Random.integer(3);
    obj.organiztionSN = Random.string('upper',3) + Random.integer(5);
    obj.appKey = Random.string(16);
    obj.appSecret = Random.string(24);
    obj.terminalType = Random.integer(1,4);
    obj.isDelete = Random.boolean();
    GetAppInfoList.push(obj);
}

var GetAppInfo = {
    // "OrganiztionSN": "CNN100366",
    // "organiztionId": "e3af1edf9b5b474f8ad59fedfde0149b",
    "organiztionId": "e3af1edf9b5b474f8ad59fedfde0149b",
    "appKey": "6640a392dfbd9c0d",
    "appSecret": "68bac75ed032e0a86bc3eae1b5c996cf",
    "appId": 'dsfddgvf',
    "identifyingNumber": 'frfjreg',
    "terminalType": 4,
    "isDelete": "1",
    "remark": "备注内容",
    "uploadFile": "data:image/png;base64,"
}
var GetOrganiztionList = [
    {
        "organiztionId": "e3af1edf9b5b474f8ad59fedfde0149b",
        "organiztionSN": "CNN100364",
    },
    {
        "organiztionId": "e3af1edf9b5b474f8ad59fedfde0149c",
        "organiztionSN": "CNN100365",
    },
    {
        "organiztionId": "e3af1edf9b5b474f8ad59fedfde0149d",
        "organiztionSN": "CNN100366",
    }
];

//获取生产激活信息列表
Mock.mock('/appInfoService/GetAppInfoList', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": { "totalCount": Random.integer(1,100), "items": GetAppInfoList }, "success": true, "error": null, "unAuthorizedRequest": false };
});

// 获取部署点列表
Mock.mock('/appInfoService/GetOrganiztionList', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": GetOrganiztionList, "success": true, "error": null, "unAuthorizedRequest": false };
});

// 获取下载链接
Mock.mock('/appInfoService/GetAppXMLDownLoadUrl', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": { "uploadUrl": "http://10.20.31.29:8089//dts//Upload//Xml/5cd1e027d74f49a88c70a23a5e7b1550.Xml" },"success": true,"message": ""};
});

// 激活信息启动/禁用
Mock.mock('/appInfoService/UpdateDeleteStatus', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "success": true,"message": ""};
});
// 新增/修改生产激活信息
Mock.mock('/appInfoService/SubmitAppInfo', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "success": true,"message": ""};
});
// 获取生产激活明细
Mock.mock('/appInfoService/GetAppInfoById', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": GetAppInfo,"success": true,"message": ""};
});
